import React from 'react';

import ScrollToBottom from 'react-scroll-to-bottom';

const Messages = (props) => (
  <ScrollToBottom>
    {props.messages.map((message, i) => (
      <div key={i}></div>
    ))}
  </ScrollToBottom>
);
